import React from "react";
import "./ManCallPage.css";

function ManCallonePage({ rowData, selectedRow }) {
  // 선택된 통화 기록의 요약 데이터 추출
  const { name, date, time, cluster, keyword, summarize } =
    rowData[selectedRow];

  return (
    <div className="call-one-container">
      <h2>통화 상세 정보</h2>
      <div className="call-info">
        <p>
          <strong>이름:</strong> {name}
        </p>
        <p>
          <strong>날짜:</strong> {date}
        </p>
        <p>
          <strong>시간:</strong> {time}
        </p>
        <p>
          <strong>분류:</strong> {cluster}
        </p>
        <p>
          <strong>키워드:</strong> {keyword}
        </p>
        <p>
          <strong>요약:</strong> {summarize}
        </p>
      </div>
    </div>
  );
}

export default ManCallonePage;
